import React from 'react'
import StudentSidebar from './StudentSidebar'

function StudentProfile() {
  return (
    <>
      <StudentSidebar/>
      <div
        style={{
          paddingTop: "100px",
          paddingLeft: "25%",
          height: "100%"
        }}
      >
        <div
        style={{
          paddingTop: "100px",
          paddingLeft: "25%",
          height: "100%"
        }}
      ></div>
      </div>
    </>
  )
}

export default StudentProfile
